INSERT INTO table_workout VALUES(798,1,'Open 17.3',replace('For Reps\nPrior to 8 minutes, 3 rounds of:\n6 Chest-to-Bar Pull-Ups\n6 Squat Snatches @43/30 kg\n\nThen 3 rounds of:\n7 Chest-to-Bar Pull-Ups\n5 Squat Snatches @61/43 kg\n\n* Prior to 12 minutes, 3 rounds of:\n8 Chest-to-Bar Pull-Ups\n4 Squat Snatches @84/61 kg\n\n* Prior to 16 minutes, 3 rounds of:\n9 Chest-to-Bar Pull-Ups\n3 Squat Snatches @102/70 kg\n\n* Prior to 20 minutes, 3 rounds of:\n10 Chest-to-Bar Pull-Ups\n2 Squat Snatches @111/80 kg\n\n* Prior to 24 minutes, 3 rounds of:\n11 Chest-to-Bar Pull-Ups\n1 Squat Snatch @120/84 kg','\n',char(10)),0);
