INSERT INTO table_workout VALUES(802,1,'Open 18.5',replace('AMRAP7\n3 Thrusters @45/30 kg\n3 Chest-to-Bar Pull-Ups\n6 Thrusters @45/30 kg\n6 Chest-to-Bar Pull-Ups\n9 Thrusters @45/30 kg\n9 Chest-to-Bar Pull-Ups\n\nIf you complete the round of 9, complete a round of 12, then go on to 15, etc.','\n',char(10)),0);
INSERT INTO table_workout VALUES(803,1,'Open 19.4',replace('For Time\n3 Rounds of:\n10 Snatches @43/30 kg\n12 Bar-Facing Burpees\n\n3 minutes Rest\n\nThen, 3 rounds of:\n10 Bar Muscle-Ups\n12 Bar-Facing Burpees\n\nTime cap: 12 minutes','\n',char(10)),0);
INSERT INTO table_workout VALUES(804,1,'Open 19.2',replace('AMRAP20\nBeginning on an 8-minute clock, complete as many reps as possible of:\n25 Toes-to-Bars\n50 Double-Unders\n15 Squat Cleans @61/38,5 kg\n25 Toes-to-Bars\n50 Double-Unders\n13 squat cleans @84/52 kg\n\nIf completed before 8 minutes, add 4 minutes to the clock and proceed to:\n25 Toes-to-Bars\n50 Double-Unders\n11 Squat Cleans @102/66 kg\n\nIf completed before 12 minutes, add 4 minutes to the clock and proceed to:\n25 Toes-to-Bars\n50 Double-Unders\n9 Squat Cleans @125/80 kg\n\nIf completed before 16 minutes, add 4 minutes to the clock and proceed to:\n25 Toes-to-Bars\n50 Double-Unders\n7 Squat Cleans @143/93 kg\n\nTime Cap: 20 minutes','\n',char(10)),0);
